#include <stdio.h>


float dot (float* a, float* b, int size){
	float sum,product;
	int   i          ;
	
	sum = 0;
	
	for (i = 0; i < size; i++) {
			product = a[i] * b[i]  ;
			sum     = sum + product;
		}
	return sum;
}

void layer_1 (float* z, float x[784], float w[10][784], float b[10]) {
	float product;
	float term   ;
	int   i      ;
	for(i = 0; i < 10; i++) {
		product = 0.0;
		term    = 0.0;
		product = dot(w[i],x,784);
		term    = product + b[i] ;
		*(z+i) = term;
	}
}

void ReLU(float* a, float* x, int size) {
	int i;
	for (i = 0; i<size; i ++){
		a[i] = (x[i] > 0.0) ? x[i] : 0.0;
	}
}

void layer_2 (float* z, float x[10], float w[10][10], float b[10]) {
	float product;
	int   i      ;
	for(i = 0; i < 10; i++) {
		product = dot(w[i],x,10);
		z[i] = product+ b[i]    ;
	}
}

int make_prediction (float x[10]){
	int prediction,i ;
	float max_val    ;
	max_val    = x[0];
	prediction = 0   ;
	
	for (i = 1; i <10; i++){
		if (x[i] > max_val){
			prediction = i   ;
			max_val    = x[i];
		}
	}
	return prediction;
}

